import React from "react";
// import { Link } from "react-router-dom";
import logoImg from "../../../img/logo.png";
import {
  BellIcon,
  MagnifyingGlassIcon,
  PlusIcon,
} from "@heroicons/react/24/solid";

export default function Header() {
  return (
    <div>
      <header className="flex w-full bg-white p-2">
        <div className="mx-4">
          <img src={logoImg} alt="" className="2-8 h-8" />
        </div>
        <form
          action=""
          className="bg-reddit_gray-brighter px-3 flex rounded-md border border-reddit_gray-600"
        >
          <MagnifyingGlassIcon className="text-gray-300 h-6 w-6 mt-1" />
          <input
            type="text"
            className="bg-reddit_gray-brighter h-6 text-sm p-1 pl-2 pr-0 block focus:outline-none text-black"
            placeholder="Search"
          />
        </form>
        <BellIcon className="  w-8 h-8" />
        <PlusIcon text-gray w-8 h-8 />
      </header>
    </div>
